sys_variable_value.value:
(function execute(inputs, outputs) {
  try {

     var content = {
       "given_name" : inputs.given_name,
       "surname" : inputs.surname,
       "email_address" : inputs.email_address,
       "contact_number" : inputs.contact_number,
       "description" : inputs.description,
       "status" : inputs.status,
       "target_email" : inputs.target_email,
       "email_to_be_added" : inputs.email_to_be_added,
       "id" : inputs.id,
       "managed_service": inputs.managed_service,
       "display_name": inputs.display_name,
       "mail_nickname": inputs.mail_nickname,
       "account_enabled": inputs.account_enabled,
       "assign_license": inputs.assign_license,
       "remove_license": inputs.remove_license,
       "restricted_service": inputs.restricted_service
        }
      var jsonStringify = JSON.stringify(content);

      var request = new sn_ws.RESTMessageV2();
      request.setHttpMethod("POST");
      request.setRequestHeader("Accept", "application/xml");
      request.setRequestHeader("Content-Type", "application/json; charset=UTF-8");
      request.setQueryParameter("name", jsonStringify);
      request.setEndpoint("https://dspocvoda.azurewebsites.net/api/Fetch");
      request.execute();
      gs.info(jsonStringify);

  } catch(ex) {



    	gs.info(ex.Message);

  }


})(inputs, outputs);

